import React from 'react';
import ReactDOM from 'react-dom';
import './card.css';
import 'bootstrap/dist/css/bootstrap.min.css'

const Card=({ id,name,username,email })=>{
    return(
        <div className="row">
            <div className="col">
                <div className="pics">
                    <img src={`https://robohash.org/${ username }?200*200`} alt="pro" />
                    <div>
                    <h1>
                        {name}
                    </h1>
                    <h1>
                        {email}
                    </h1>
                    </div>
                </div>
            </div>
        </div>
    )
}

export default Card;
